let cdds_lines=w.sep(cdds,'\n')
let rs=[]
_.each(cdds_lines,(l)=>{
    let s=_.split(l,'\t')
    if(!w.isnum(gv(s,0))){
        return true //跳出換下一個
    }
    let o={
        depth:gv(s,0),
        qc:gv(s,1),
        fs:gv(s,2),
        u2:gv(s,3),
    }
    let m1={
        depth:gv(s,4),
        qc:gv(s,5),
        fs:gv(s,6),
        u2:gv(s,7),
    }
    let m2={
        depth:gv(s,8),
        qc:gv(s,9),
        fs:gv(s,10),
        u2:gv(s,11),
    }
    rs.push({
        o,m1,m2
    })
})
console.log('rs',rs)

        <script>
let iscs=0
let scs=[]
_.each(rs,(r,k)=>{
    if(k===0){
        return true //跳出換下一個
    }
    let d0=gv(rs,`${k-1}.o.depth`)
    let d1=gv(rs,`${k}.o.depth`)
    let v0=gv(rs,`${k-1}.o.qc`)
    let v1=gv(rs,`${k}.o.qc`)
    // console.log(r,d0,v0,d1,v1)
    if(w.isnum(v0) && !w.isnum(v1)){
        console.log('jump',r.o)
        iscs++
        let ds=w.dig(d0-1,2)
        let de=w.dig(d0+1,2)
        let sc={
            ds,
            de,
            dr:`第 ${iscs} 急墜段(${ds}-${de}m)`,
            h:700,
        }
        scs.push(sc)
    }
})

    {
        ds:0,
        de:100,
        dr:`全深度(0-100m)`,

    },
    ...scs,
]

        <script>
let up=_.size(rs)-1
let scrss=[]
_.each(scs,(sc)=>{

    //ids
    let ids=null
    _.each(rs,(r,kr)=>{
        if(r.o.depth>sc.ds){
            ids=kr
            return false //跳出
        }
    })

    //ide
    let ide=null
    _.each(rs,(_r,_kr)=>{
        let kr=up-_kr
        let r=rs[kr]
        if(r.o.depth<sc.de){
            ide=kr
            return false //跳出
        }
    })

    let gs=[]
    _.each(['qc','u2','fs'],(pk)=>{
        let ors=[]
        let m1rs=[]
        let m2rs=[]
        for(let i=ids;i<=ide;i++){
            let o=rs[i].o
            let m1=rs[i].m1
            let m2=rs[i].m2
            let depth=o.depth
            ors.push([depth,o[pk]])
            m1rs.push([depth,m1[pk]])
            m2rs.push([depth,m2[pk]])
        }
        gs[pk]={
            ors,
            m1rs,
            m2rs,
        }
    })

    scrss.push({
        sc,
        gs,
    })

})
console.log('scrss',scrss)
